import React from "react";
import Card from "react-bootstrap/Card";
import img1 from "./images/novice.png";
import { Link } from "react-router-dom";
import Button from "react-bootstrap/Button"
// import Button from 'react-bootstrap/Button';





function Cards() {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img variant="top" src={img1} />
      <Card.Body>
        <Card.Title>Novice</Card.Title>
        <Card.Text>
          Nosedive into the world of Computing with our entry level products.
        </Card.Text>
        <Link to ='/novice' className = "Button" variant="danger">Visit the Novice Shop!</Link>
        
      </Card.Body>
    </Card>
  );
}

export default Cards;
